INSERT INTO `ms_job` VALUES ('1', '医疗销售', '3', '北京海淀', '销售', '<p>\r\n	1、史蒂夫合适的话发送到\r\n</p>\r\n<p>\r\n	2、收款方见识到了看风景时口袋里放\r\n</p>\r\n<p>\r\n	3、第三节疯狂圣诞节疯狂了坚实的李开复\r\n</p>\r\n<p>\r\n	4、就是大开发见识到了快捷方式领导\r\n</p>', '<p>\r\n	1、认识他狗日的太鼓达人\r\n</p>\r\n<p>\r\n	2、的复合弓对符合法规和发个\r\n</p>\r\n<p>\r\n	3、第三节疯狂圣诞节疯狂了坚实的李开复\r\n</p>\r\n<p>\r\n	4、就是大开发见识到了快捷方式领导\r\n</p>\r\n<p>\r\n	5、史蒂夫合适的话发送到\r\n</p>\r\n<p>\r\n	6、收款方见识到了看风景时口袋里放\r\n</p>\r\n<p>\r\n	7、第三节疯狂圣诞节疯狂了坚实的李开复\r\n</p>\r\n<p>\r\n	8、就是大开发见识到了快捷方式领导\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '2017-03-23 16:10:46', '2017-03-31'), ('2', '网络营销', '2', '北京朝阳', '销售', '<p>\r\n	1、大会上款福克斯垃圾分类看到\r\n</p>\r\n<p>\r\n	2、手机打开链接看撒开了多久了\r\n</p>\r\n<p>\r\n	3、记得搜集弗兰克的解放路\r\n</p>\r\n<p>\r\n	4、就是看见对方考虑时间发了1\r\n</p>', '<p>\r\n	1、大会上款福克斯垃圾分类看到发的好地方\r\n</p>\r\n<p>\r\n	2、手机打开链接看撒开了多久了地方和东方红\r\n</p>\r\n<p>\r\n	3、记得搜集弗兰克的解放路的发挥地方规划\r\n</p>\r\n<p>\r\n	4、就是看见对方考虑时间发了对符合法规和个\r\n</p>\r\n<p>\r\n	5、大街上客服就是考虑到解放了圣诞节\r\n</p>', '2017-03-23 16:10:39', '2017-04-01'), ('3', '运营', '11', '丰台', '技术', '<p>\r\n	1、记得时刻就疯狂圣诞节疯狂\r\n</p>\r\n<p>\r\n	2、佛就开始打几分\r\n</p>\r\n<p>\r\n	3、担惊受恐福利局圣诞快乐福建省考虑到1\r\n</p>', '<p>\r\n	1、就是打开佛就开始打几分\r\n</p>\r\n<p>\r\n	2、就是打开飞机速度快解放\r\n</p>\r\n<p>\r\n	3、担惊受恐六角恐龙打暑假工\r\n</p>', '2017-03-23 16:10:23', '2017-03-29');
COMMIT;

