-- ----------------------------
--  Table structure for `ms_orders`
-- ----------------------------
DROP TABLE IF EXISTS `ms_orders`;
CREATE TABLE `ms_orders` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `ordernum` varchar(50) NOT NULL COMMENT '生成订单编号',
  `userid` int(10) NOT NULL,
  `pid` int(11) NOT NULL COMMENT '产品id',
  `money` decimal(10,2) NOT NULL COMMENT '钱数',
  `corn` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所需积分',
  `orderstatus` tinyint(1) NOT NULL DEFAULT '1' COMMENT '订单状态:0已取消1待支付,2已支付待发货,3待收货,4待评价',
  `transaction_id` varchar(255) DEFAULT NULL COMMENT '微信支付订单号',
  `time_end` varchar(20) DEFAULT NULL COMMENT '支付完成时间',
  `total_fee` int(10) NOT NULL DEFAULT '0' COMMENT '订单金额',
  `paytype` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0积分1微信2支付宝',
  `fhtime` varchar(20) DEFAULT NULL COMMENT '发货时间',
  `shippernum` varchar(100) DEFAULT NULL COMMENT '快递单号',
  `shipperid` tinyint(3) NOT NULL DEFAULT '0' COMMENT '物流商家',
  `commented` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未评价1已评价',
  `invoice` varchar(155) DEFAULT NULL COMMENT '发票',
  `invoiceemail` varchar(100) NOT NULL COMMENT '发票接收邮箱',
  `deled` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0正常1删除',
  `addtime` datetime NOT NULL COMMENT '下单时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ordernum` (`ordernum`)
) ENGINE=InnoDB AUTO_INCREMENT=96 DEFAULT CHARSET=utf8 COMMENT='订单表';

