-- ----------------------------
--  Table structure for `ms_products`
-- ----------------------------
DROP TABLE IF EXISTS `ms_products`;
CREATE TABLE `ms_products` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `terminal` smallint(6) NOT NULL DEFAULT '0' COMMENT '终端，1电脑加手机，2电脑，3手机',
  `number` varchar(255) NOT NULL COMMENT '产品编号',
  `type` smallint(6) NOT NULL DEFAULT '0' COMMENT '网站类型',
  `industry` smallint(6) NOT NULL DEFAULT '0' COMMENT '适用行业',
  `colour` smallint(6) NOT NULL DEFAULT '0' COMMENT '主题颜色',
  `designer` varchar(50) NOT NULL COMMENT '设计师',
  `cateid` smallint(5) unsigned NOT NULL DEFAULT '0',
  `productnum` varchar(50) NOT NULL,
  `title` varchar(255) NOT NULL,
  `logopic` varchar(255) NOT NULL COMMENT 'logo图片',
  `titlepic` varchar(255) NOT NULL COMMENT '电脑图片',
  `phonepic` varchar(255) DEFAULT NULL COMMENT '手机图片',
  `smalltext` text NOT NULL,
  `price` decimal(10,2) NOT NULL COMMENT '价格',
  `totalnum` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '库存总数',
  `salenum` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `vsalenum` int(10) unsigned NOT NULL DEFAULT '1000' COMMENT '初始销量',
  `postfee` tinyint(3) NOT NULL DEFAULT '0' COMMENT '0为包邮',
  `content` longtext NOT NULL,
  `showturn` smallint(5) NOT NULL,
  `url` varchar(255) NOT NULL COMMENT '产品链接',
  `isnew` smallint(6) NOT NULL DEFAULT '1' COMMENT '是否设置最新，1最新，0不设置',
  `addtime` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='产品表';

