-- ----------------------------
--  Table structure for `ms_user`
-- ----------------------------
DROP TABLE IF EXISTS `ms_user`;
CREATE TABLE `ms_user` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `cateid` tinyint(1) NOT NULL DEFAULT '1' COMMENT '类别ID:1用户2医生',
  `phone` varchar(11) NOT NULL COMMENT '手机/邮箱',
  `nickname` varchar(100) DEFAULT NULL COMMENT '昵称',
  `headpic` varchar(250) DEFAULT NULL,
  `password` varchar(32) NOT NULL COMMENT '密码',
  `isremember` smallint(6) NOT NULL DEFAULT '1' COMMENT '1记住密码，2不记住',
  `sex` tinyint(1) DEFAULT '0' COMMENT '1男2女',
  `jobs` varchar(100) DEFAULT NULL COMMENT '职业',
  `city` varchar(100) DEFAULT NULL COMMENT '所在城市',
  `openid` varchar(255) DEFAULT NULL,
  `detailed` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未填写1信息已填',
  `qa` varchar(100) DEFAULT NULL,
  `addtime` datetime NOT NULL,
  `authority` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '权限',
  PRIMARY KEY (`id`),
  UNIQUE KEY `phone` (`phone`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='用户表';

