-- ----------------------------
--  Table structure for `ms_user_addr`
-- ----------------------------
DROP TABLE IF EXISTS `ms_user_addr`;
CREATE TABLE `ms_user_addr` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userid` int(10) NOT NULL,
  `name` varchar(50) NOT NULL,
  `phone` varchar(15) NOT NULL,
  `addrcode` varchar(50) NOT NULL COMMENT '地区编码',
  `addrtail` varchar(255) NOT NULL COMMENT '详细地址',
  `postno` varchar(6) NOT NULL,
  `comment` text NOT NULL,
  `addtime` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='用户地址';

-- ----------------------------
--  Table structure for `ms_user_probe`
-- ----------------------------
DROP TABLE IF EXISTS `ms_user_probe`;
CREATE TABLE `ms_user_probe` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `userid` int(10) NOT NULL,
  `q1` varchar(100) DEFAULT NULL,
  `q2` varchar(50) DEFAULT NULL,
  `q2a` varchar(100) DEFAULT NULL,
  `q3` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `userid` (`userid`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='用户调查';

