  `userid` mediumint(8) NOT NULL,
  `logip` varchar(15) DEFAULT NULL,
  `addtime` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='用户登录统计表';

-- ----------------------------
--  Table structure for `ms_usermeta`
