DROP TABLE IF EXISTS `ms_usermeta`;
CREATE TABLE `ms_usermeta` (
  `id` int(12) NOT NULL AUTO_INCREMENT,
  `userid` int(12) NOT NULL COMMENT '用户ID',
  `field` varchar(60) NOT NULL COMMENT '键',
  `value` varchar(255) NOT NULL COMMENT '值',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='用户扩展';

